import React, { useState } from 'react';
import './App.css';
import Headerbar from './Headerbar';
import Avilable from './Avilable';
import Favourites from './Favourites';
import Footer from './Footer';

function App() {
  const [isAdvancedSearchVisible, setIsAdvancedSearchVisible] = useState(false);

  const toggleAdvancedSearch = () => {
    setIsAdvancedSearchVisible(!isAdvancedSearchVisible);
  };

  return (
    <div className="App">
      <Headerbar />
      <button className='advancedSearchButton' onClick={toggleAdvancedSearch}>
        Advanced search
      </button>
      {isAdvancedSearchVisible && (
        <div>
          {/* Content for the advanced search section */}
          <p>Advanced search content goes here.</p>
        </div>
      )}
      <div className='App-innerdiv'>
        <Avilable />
        <Favourites />
      </div>
      <Footer />
    </div>
  );
}

export default App;
